// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/automation/interfaces/ILogAutomation.sol";

interface tgetherCommunitiesInterface {
    function getCommunityOwner(string memory _communityName) external view returns (address);
    function CustomProposal(string memory _communityName, address _contractAddress) external payable returns (uint256);
    function getProposalResults(uint256 _proposalId) external view returns (bool isActive, bool passed);
    function getFee() external view returns (uint256);
}

interface tgetherFundInterface {
    function fundUpkeep(address _contractAddress) external payable returns (bool);
}

contract tgetherIncentives is ILogAutomation {

    // Enum to define the structure of incentives, either equal or consensus-aligned.
    enum IncentiveStructure {
        Equal,
        ConsensusAligned
    }

    // Struct to store parameters related to incentives
    struct IncentiveParams {
        IncentiveStructure structure;
        uint256 communityFee;
        address payable contractReceiveAddress;
        bool isSet; // Ensures parameters have been initialized
    }

    // Struct to store proposal details for incentives
    struct IncentiveProposal {
        address proposer;
        string communityName;
        IncentiveStructure structure;
        uint256 communityFee;
        address payable contractReceiveAddress;
        bool upkeeped;
        bool passed;
    }

    // Mappings for storing incentive structures and proposals
    mapping(string => IncentiveParams) public IncentiveStructures;
    mapping(uint256 => IncentiveProposal) public IncentiveProposals;

    string[] public ContractParameterKeys = ["structure", "communityFee", "contractReceiveAddress", "isSet"];

    // Contract addresses and fees
    address private owner;
    uint256 public fee;
    uint256 public TGCommunitiesFee;
    uint256 public totalFee;
    tgetherFundInterface public FundContract;
    tgetherCommunitiesInterface public CommunityContract;
    address public thisAddress = address(this);
    uint256 public upkeepId;

    // Events to notify when actions are performed
    event IncentiveStructureSet(
        string communityName,
        IncentiveStructure structure,
        uint256 communityFee,
        address payable contractReceiveAddress
    );

    event IncentiveProposalCreated(
        uint256 proposalId,
        address proposer,
        string communityName,
        IncentiveStructure structure,
        uint256 communityFee,
        address payable contractReceiveAddress
    );

    event IncentiveParamsUpdated(
        string communityName,
        IncentiveStructure structure,
        uint256 communityFee,
        address payable contractReceiveAddress
    );

    // Constructor to initialize contract
    constructor(
        uint256 _feePrice,
        address _communityContractAddress,
        uint256 _communityFee,
        address _fundContract
    ) {
        owner = msg.sender;
        CommunityContract = tgetherCommunitiesInterface(_communityContractAddress);
        FundContract = tgetherFundInterface(_fundContract);
        fee = _feePrice;
        TGCommunitiesFee = _communityFee;
        totalFee = fee + TGCommunitiesFee;
    }

    // Modifier to restrict access to the contract owner
    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    // --- External Functions to Set Parameters ---

    // 1. Standard setter for parameters using explicit inputs
    function setParams(
        string memory _communityName,
        IncentiveStructure _structure,
        uint256 _communityFee,
        address payable _contractReceiveAddress
    ) external {
        _setParamsInternal(
            _communityName,
            _structure,
            _communityFee,
            _contractReceiveAddress
        );
    }

    // 2. Setter for parameters using bytes input (for flexibility)
    function setParametersAsBytes(
        string memory _communityName,
        bytes memory _params
    ) external {
        (
            IncentiveStructure structure,
            uint256 communityFee,
            address payable contractReceiveAddress
        ) = abi.decode(_params, (IncentiveStructure, uint256, address));

        _setParamsInternal(
            _communityName,
            structure,
            communityFee,
            contractReceiveAddress
        );
    }

    // 3. Internal function containing the logic for setting parameters (called by both external functions)
    function _setParamsInternal(
        string memory _communityName,
        IncentiveStructure _structure,
        uint256 _communityFee,
        address payable _contractReceiveAddress
    ) internal {
        // Ensure only the community owner can set parameters
        require(
            CommunityContract.getCommunityOwner(_communityName) == msg.sender,
            "Not the owner of this community"
        );
        // Prevent overriding of already set parameters
        require(
            !IncentiveStructures[_communityName].isSet,
            "Parameters already set"
        );

        IncentiveParams storage params = IncentiveStructures[_communityName];
        params.structure = _structure;
        params.communityFee = _communityFee;
        params.contractReceiveAddress = _contractReceiveAddress;
        params.isSet = true;

        // Emit event when parameters are successfully set
        emit IncentiveStructureSet(
            _communityName,
            _structure,
            _communityFee,
            _contractReceiveAddress
        );
    }

    // --- External Functions to Create Proposals ---

    // 1. Create proposal using explicit inputs
    function createProposal(
        string memory _communityName,
        IncentiveStructure _structure,
        uint256 _communityFee,
        address payable _contractReceiveAddress
    ) external payable returns (uint256) {
        return _createProposalInternal(
            _communityName,
            _structure,
            _communityFee,
            _contractReceiveAddress
        );
    }

    // 2. Create proposal using bytes input (for flexibility)
    function createProposalAsBytes(
        string memory _communityName,
        bytes memory _params
    ) external payable returns (uint256) {
        (
            IncentiveStructure structure,
            uint256 communityFee,
            address payable contractReceiveAddress
        ) = abi.decode(_params, (IncentiveStructure, uint256, address));

        return _createProposalInternal(
            _communityName,
            structure,
            communityFee,
            contractReceiveAddress
        );
    }

    // 3. Internal function containing the logic for creating proposals (called by both external functions)
    function _createProposalInternal(
        string memory _communityName,
        IncentiveStructure _structure,
        uint256 _communityFee,
        address payable _contractReceiveAddress
    ) internal returns (uint256) {
        // Ensure that the proposal fee is paid correctly
        require(msg.value == totalFee, "Incorrect fee");
        require(
            _communityFee == 0 || _contractReceiveAddress != address(0),
            "Invalid receive address"
        );

        // Create a proposal by interacting with the community contract
        uint256 proposalId = CommunityContract.CustomProposal{
            value: TGCommunitiesFee
        }(_communityName, thisAddress);
        require(proposalId > 0, "Proposal creation failed");

        // Store the proposal details
        IncentiveProposal storage proposal = IncentiveProposals[proposalId];
        proposal.proposer = msg.sender;
        proposal.communityName = _communityName;
        proposal.structure = _structure;
        proposal.communityFee = _communityFee;
        proposal.contractReceiveAddress = _contractReceiveAddress;

        // Fund upkeep for the proposal
        bool isFunded = FundContract.fundUpkeep{
            value: msg.value - TGCommunitiesFee
        }(thisAddress);
        require(isFunded, "Funding upkeep failed");

        // Emit event when proposal is created
        emit IncentiveProposalCreated(
            proposalId,
            msg.sender,
            _communityName,
            _structure,
            _communityFee,
            _contractReceiveAddress
        );

        return proposalId;
    }

    // --- Read Functions ---

    // Standard function to retrieve the parameters for a given community (returns bytes)
    function getParams(
        string memory _communityName
    ) external view returns (bytes memory) {
        IncentiveParams storage params = IncentiveStructures[_communityName];
        return abi.encode(
            params.structure,
            params.communityFee,
            params.contractReceiveAddress,
            params.isSet
        );
    }

    // Standardized function to retrieve the fee
    function getFee() external view returns (uint256) {
        return fee;
    }

    // --- Utility and Helper Functions ---

    // Convert a bytes32 address to an actual address
    function bytes32ToAddress(bytes32 _address) public pure returns (address) {
        return address(uint160(uint256(_address)));
    }

    // Function to retrieve proposal details
    function getProposal(
        uint256 _proposalId
    ) external view returns (IncentiveProposal memory) {
        return IncentiveProposals[_proposalId];
    }

    // Function to check if incentive parameters exist for a community
    function getIncentiveParamsExist(
        string memory _communityName
    ) external view returns (bool _isSet) {
        return (IncentiveStructures[_communityName].isSet);
    }

    function getInctiveStructure(string memory _communityName) external view returns (IncentiveStructure){
        return IncentiveStructures[_communityName].structure;
    }

    // Function to retrieve incentive structure for a community
    function getIncentiveStructure(
        string memory _communityName
    ) external view returns (IncentiveStructure) {
        return IncentiveStructures[_communityName].structure;
    }

    // Retrieve community fee and receiving contract address
    function getCommunityFeeInfo(
        string memory _communityName
    )
        external
        view
        returns (uint256 _communityFee, address _contractReceiveAddress)
    {
        return (
            IncentiveStructures[_communityName].communityFee,
            IncentiveStructures[_communityName].contractReceiveAddress
        );
    }

    // --- Admin and Maintenance Functions ---

    // Set the community contract (only by owner)
    function settgetherCommunityContract(
        address _contractAddress
    ) external onlyOwner {
        CommunityContract = tgetherCommunitiesInterface(_contractAddress);
    }

    // Set the fee (only by owner)
    function setFee(uint256 _feePrice) external onlyOwner {
        fee = _feePrice;
    }

    // Update the total fee (only by owner)
    function updateTotalFee() external onlyOwner {
        uint256 _comFee = CommunityContract.getFee();
        TGCommunitiesFee = _comFee;
        totalFee = fee + _comFee;
    }

    // Set the fund contract (only by owner)
    function setFundContract(address _contract) external onlyOwner {
        FundContract = tgetherFundInterface(_contract);
    }

    // --- Chainlink Automation Functions ---

    /*
        * @notice Checklog function for the upkeep of the contract.
        * @dev Ensures the proposal exists in this contract and is not upkeeped.
        * @param log The log to check.
        * @return _performData The bytes transformed proposal id to upkeep
        * @return upkeepNeeded If the upkeep is needed.
    */
    function checkLog(
        Log calldata log,
        bytes memory 
    ) external view returns (bool upkeepNeeded, bytes memory performData) {
        address _contractAddress = bytes32ToAddress(log.topics[1]);
        uint256 _proposalId = uint256(log.topics[2]);

        if(_contractAddress == thisAddress && IncentiveProposals[_proposalId].proposer != address(0) && IncentiveProposals[_proposalId].upkeeped == false ){
            upkeepNeeded = true;
        }

        return (upkeepNeeded, abi.encode(_proposalId));
    }

    /*
        * @notice Performs the upkeep of the contract.
        * @dev Ensures the proposal exists in this contract and is not upkeeped.
        * @dev Ensures the proposal is no longer active and updates the community incentive params if passed.
        * @param _performData The bytes transformed proposal id to upkeep
    */
    function performUpkeep(bytes calldata _performData) external {
        uint256 _proposalId = abi.decode(_performData, (uint256));

        if(IncentiveProposals[_proposalId].proposer != address(0)){
            (bool _isActive, bool _passed) = CommunityContract.getProposalResults(_proposalId);

            if (_isActive == false) {
                if (_passed) {
                    IncentiveProposal memory iPP = IncentiveProposals[_proposalId];
                    iPP.upkeeped = true;
                    iPP.passed = true;
                    IncentiveProposals[_proposalId] = iPP;

                    IncentiveParams storage iP = IncentiveStructures[iPP.communityName];
                    iP.structure = iPP.structure;
                    iP.communityFee = iPP.communityFee;
                    iP.contractReceiveAddress = iPP.contractReceiveAddress;

                    if (iP.isSet == false) {
                        iP.isSet = true;
                    }

                    emit IncentiveParamsUpdated(iPP.communityName, iP.structure, iP.communityFee, iP.contractReceiveAddress);
                } else {
                    IncentiveProposal memory iPP = IncentiveProposals[_proposalId];
                    iPP.upkeeped = true;
                    iPP.passed = false;
                    IncentiveProposals[_proposalId] = iPP;
                }
            }
        }
    }

    function getContractParameterKeys() external view returns (string[] memory) {
        return ContractParameterKeys;
    }
}

